import React from 'react';
import './study.css';
import usa from '../images/usas.jpg';
import { Link } from "react-router-dom";
import logo3 from '../images/l.png';
import glob from '../images/globes.png';
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

const makeCall = () => {
    window.location.href = "tel:+6281187094";
};

const particlesInit = async (main) => {
    await loadFull(main);
};

function StudyUSA() {
    return (
        <div>
            {/* Navbar Section */}
            <div className='logsec'>
                <img style={{ height: '60px', width: '200px', marginTop: '-10px', marginLeft: '70px' }} src={logo3} alt='lg' />
                <img style={{ height: '100px', width: '330px', marginLeft: '300px', marginTop: '-10px' }} className='imgt' src={glob} alt='glb' />
                <button onClick={makeCall} style={{ marginLeft: '460px', borderRadius: '20%' }}>
                    Contact us
                </button>
            </div>
            <header className="header">
                <nav className="custom-navbar">
                    <ul className="nav-links">
                        <li className="dropdown">
                            <li> <Link to="/" className="home-button">Home</Link></li>
                        </li>
                        <li><Link to="/about">About Us</Link></li>
                        <li><Link to="/studyloans">Study Loans</Link></li>
                        <li><Link to="/englishtests">English Tests</Link></li>
                        <li><Link to="/blog">Blog</Link></li>
                        <li><Link to="/contact">Contact Us</Link></li>
                    </ul>
                </nav>
            </header>

            {/* Particles Background */}
            <Particles
                id="tsparticles"
                init={particlesInit}
                options={{
                    background: {
                        color: "#ffffff", // Set background color (adjust as needed)
                    },
                    particles: {
                        number: {
                            value: 80, // Adjust particle count
                        },
                        size: {
                            value: 3, // Adjust particle size
                        },
                        move: {
                            speed: 2, // Particle movement speed
                        },
                        links: {
                            enable: true, // Enable linking between particles
                            opacity: 0.5,
                            distance: 150,
                        },
                        color: {
                            value: "#000000", // Particle color
                        },
                    },
                }}
            />

            {/* Page Content */}
            <div className='mainusa'>
                <img src={usa} alt='USA Image' />
            </div>
        </div>
    );
}

export default StudyUSA;
